import Nav from './components/Nav'
import Button from './components/Button'
import Quote from './components/Quote'
import { useState } from 'react'
import TaskPage from './components/TaskPage'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

function App() {

  const [tasks, setTasks] = useState([
    {
      id: 1,
      title: 'Wash Up',
      task: 'Clean up all the dishes in the kitchen!'
    },
    {
      id: 2,
      title: 'Work Out',
      task: 'Chest and Shoulders weightlifting session'
    },
    {
      id: 3,
      title: 'Study',
      task: 'Spend 2 hours reading through React Documentation'
    }
  ]
  )

  return (
    <Router>
      <div className="App">
        <Nav title='My Planner' />


        <Routes>
          <Route path='/tasks' element={<TaskPage tasks={tasks} />}/>
          <Route path='/quotes' element={<Quote />}/>
          <Route path='/' element={<Button color='blue' /> }/>
        </Routes>

      </div>
    </Router>
  );
}

export default App;
